  background-color: #fff;
  height: 50px;
  margin: 20px;
  flex-direction: row;
  border-bottom-width: 2px;
  border-bottom-color: #fefefe11;
`;

const HomeListDiv = styled(ScrollView)`
  flex: 1;
`;

const SearchBar = styled(TextInput)`
